// MainPage.js
import React from 'react';

function MainPage() {
  return (
    <div className="MainPage">
      <h1>Welcome to the Main Page</h1>
      <p>로그인 후 이동한 페이지입니다!</p>
    </div>
  );
}

export default MainPage;
